package adt;import java.util.Iterator;import java.util.function.Predicate;/** * * @author Zy */public interface ListInterface<T> {    public Iterator<T> getIterator();    public ListInterface<T> search(Predicate<T> criteria);    public boolean add(T newData);    public boolean add(int newPosition, T newData);    public boolean remove(int position);    public void reset();    public boolean update(int position, T newData);    public T getData(int position);    public int getTotalNumberOfData();    public boolean isEmpty();    public int countNode();        public boolean contains(T data);}